import React from 'react';
import { Doughnut } from 'react-chartjs-2';
import './MySkills.css'; // Make sure to link this CSS file for styles

const MySkills = () => {
  // Data for the donut chart (10 equal parts)
  const chartData = {
    labels: ['Block 1', 'Block 2', 'Block 3', 'Block 4', 'Block 5', 'Block 6', 'Block 7', 'Block 8', 'Block 9', 'Block 10'],
    datasets: [
      {
        data: Array(10).fill(10), // 10 equal blocks (each 10% of the chart)
        backgroundColor: ['#FF6384', '#36A2EB', '#FFCE56', '#4BC0C0', '#F7464A', '#46BFBD', '#FDB45C', '#949FB1', '#4D5360', '#AC64AD'],
        hoverBackgroundColor: ['#FF6384', '#36A2EB', '#FFCE56', '#4BC0C0', '#F7464A', '#46BFBD', '#FDB45C', '#949FB1', '#4D5360', '#AC64AD']
      }
    ]
  };

  return (
    <div className="skills-container">
      <div className="skills-text1">
        <h2>Role:</h2>
        <p>Account Executive</p>
      </div>
      <div className="skills-text2">
        <h2>Level:</h2>
        <p>Intermediate</p>
      </div>
      {[...Array(6)].map((_, index) => (
        <div key={index} className={`box-card${index + 1}`}>
          <Doughnut data={chartData} options={{ cutout: '70%', responsive: true, maintainAspectRatio: false }} />
        </div>
      ))}
      <footer className="footer">
        <p>Â© Copyrights Protected by Vekla</p>
      </footer>
    </div>
  );
};

export default MySkills;
